import React from 'react'
import './Collection.css'
import data from '../Assets/data'
import Item from '../Item/Item'
const Collection = () => {
  return (
    <div className='grid-gallery'>
        <div className="items">
          <img src="https://plus.unsplash.com/premium_photo-1661597265308-934005c78491?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MXx8d29tZW4lMjBmYXNoaW9ufGVufDB8fDB8fHww" alt="" /> 
        </div>
      
    </div>
  )
}

export default Collection

